import React from "react";
import Header from "../Header";

export default class ArticleMaker extends React.Component {
  render() {
    return (
      <>
        <header>
          <Header user={this.props.user} />
        </header>
        <main>
          <form>
            Post an Article <br />
            <label>
              Article Content
              <input type="textarea" />
            </label>
            <button>Submit</button>
          </form>
        </main>
      </>
    );
  }
}
